import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';
import {
  Budget,
  Inventory,
  Reports,
  Recipes,
  Orders,
  Goals,
  Dashboard,
  Settings
} from './pages';

class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route exact path='/dashboard'>
            <Dashboard />
          </Route>
          <Route path='/inventory'>
            <Inventory />
          </Route>
          <Route path='/budget'>
            <Budget />
          </Route>
          <Route path='/goals'>
            <Goals />
          </Route>
          <Route path='/settings'>
            <Settings />
          </Route>
        </Switch>
      </Router>
    )
  }
}
export default App;
